import React from "react";
import Cards from "./Cards";
import contacts from "../contacts.js";


function App() {
  return (
    <div>
      <Cards name={contacts[0].name} imgURL={contacts[0].imgURL} phone={contacts[0].phone} email={contacts[0].email}/>
      <Cards name={contacts[1].name} imgURL={contacts[0].imgURL} phone={contacts[0].phone} email={contacts[0].email}/>
      <Cards name={contacts[0].name} imgURL={contacts[0].imgURL} phone={contacts[0].phone} email={contacts[0].email}/>
    </div>
  );
}

export default App;
